:div [:p {:style {:font-style \"italic\", :font-family \"\\\"Lucida Console\\\", Courier, monospace\"}} [:small \"(dereferenced)\"]] [:p/code {:code \"12\\n\"}]]]], \"464\" [:div nil [:div [:p/markdown \"## Unit tests\\n\\nComing soon.\"]]], \"468\" [:div nil [:div [:p/markdown \"## Notes\\n\\nHere is a note:\"]]], \"417\" [:div nil [:div [:p/markdown \"### dataset\\n\\nNotes of kind `:dataset` are expecting a dataset that prints nicely as a table in markdown (for exaple, a dataset of the [tech.ml.dataset](github.com/techascent/tech.ml.dataset) and [Tablecloth](https://github.com/scicloj/tablecloth) libraries).\\n\\nIt wraps the resulting markdown with nice Bootstrap CSS classes, so that the table is displayed nicely.\\n\\nWe do not have an example here, since that would require depending on the above libraries.\"]]], \"451\" [:div nil [:div [:p/markdown \"Notes which are forms like `(def ...)` or `(defn ...)` are assigned the kind `:void`.\"]]], \"351\" [:div nil [:div [:p/markdown \"This is the default kind, so usually there is no need to mention it.\"]]], \"501\" [:div [:p/code {:code \"^k/hiccup\\n[:big [:big 3]]\", :bg-class \"bg-light\"}] [:div [:big [:big 3]]]], \"487\" [:div [:p/code {:code \"(delay (+ 1 2))\", :bg-class \"bg-light\"}] [:div [:div [:p {:style {:font-style \"italic\", :font-family \"\\\"Lucida Console\\\", Courier, monospace\"}} [:small \"(dereferenced)\"]] [:p/code {:code \"3\\n\"}]]]], \"608\" [:div nil [:div [:p/markdown \"Notes which are sequential forms beginning with a string (e.g., `[\\\"Hello!\\\" \\\"How are you?\\\"]`) are assigned the default kind `:md-nocode`  automatically.\\nThis very text you are reading is an example of a note of that kind.\"]]], \"523\" [:div [:p/code {:code \"^k/hiccup\\n[:p/player\\n {:width  \\\"100%\\\"\\n  :height \\\"100%\\\"\\n  :url    \\\"https://www.youtube.com/watch?v=G512fvK9KXA\\\"}]\", :bg-class \"bg-light\"}] [:div [:p/player {:width \"100%\", :height \"100%\", :url \"https://www.youtube.com/watch?v=G512fvK9KXA\"}]]], \"292\" [:div nil [:div [:p/markdown \"### Listening to changes\\n\\n`(notespace.api/listen)` will tell Notespace to listen to changes in the file corresponding to the current namespace (on a file save). When changes occur, (notespace.api/eval-and-realize-notes-from-change) is called. This results in an [Oz](https://github.com/metasoarous/oz)-like live-reload experience.\\n\\n`(notespace.api/unlisten)` will tell Notespace to stop listening to the current namespace.\"]]], \"23\" [:div nil [:div [:p {:style {:font-style \"italic\", :font-family \"\\\"Lucida Console\\\", Courier, monospace\"}} [:small \"(not ready - unknown reason)\"]]]], \"435\" [:div [:p/code {:code \"^k/dataset-grid\\n[{:a 1 :b 4}\\n {:a 2 :b 5}\\n {:a 3 :b 6}]\", :bg-class \"bg-light\"}] [:div [:div {:class \"ag-theme-balham\", :style {:height \"150px\"}} [:p {:style {:font-style \"italic\", :font-family \"\\\"Lucida Console\\\", Courier, monospace\"}} [:small \"((showing at most 100 rows))\"]] [:p/dataset {:columnDefs [{:headerName \"a\", :field \"a\"} {:headerName \"b\", :field \"b\"}], :rowData ({\"a\" 1, \"b\" 4} {\"a\" 2, \"b\" 5} {\"a\" 3, \"b\" 6})}]]]], \"52\" [:div [:p/code {:code \"^k/hiccup\\n[:big [:big 3]]\", :bg-class \"bg-light\"}] [:div [:p {:style {:font-style \"italic\", :font-family \"\\\"Lucida Console\\\", Courier, monospace\"}} [:small \"(not ready - unknown reason)\"]]]], \"243\" [:div nil [:div [:p/markdown \"## Notes\\n\\nHere is a note:\"]]], \"309\" [:div nil [:div [:p/markdown \"If a note's value is a future, then Notespace will be informed when that future is realized. This allows Notespace to update its state with the dereferenced value.\\n\\nFor example, the following note should render after two seconds (of waiting for `x` to be realized).\"]]], \"79\" [:div nil [:div nil]], \"160\" [:div nil [:div [:p/markdown \"## Notes\\n\\nHere is a note:\"]]], \"579\" [:div nil [:div [:p/markdown \"### dataset\\n\\nNotes of kind `:dataset` are expecting
